$.loadPage = function(url){
	$.showIndicator();
	$.ajax({
		url:url,
		data:current_param,
		type:"POST",
		success:function(html){
			//$(".content").html($(html).find(".content").html());
			$(".page").replaceWith($(html).find(".page"));
			$(".panel").html($(html).find(".panel").html());
			$.hideIndicator(); 			
			set_current_url(url,current_param);
			$.init();				
		},
		error:function()
		{
			$.toast("请求超时");
			$.hideIndicator(); 
		}
	});		
};
